import Layout from "../components/Layout";
const Index = (props) => (
  <Layout>
    <div>
      <h1>To Do App</h1>
    </div>
  </Layout>
);

Index.getInitialProps = async () => {
  const response = await fetch("http://localhost:3333/api/tasks");
  const tasks = await response.json();
  return { tasks };
};

export default Index;
